import { Doughnut } from 'react-chartjs-2'
import styled from 'styled-components'

const Graph = styled.div`
  width: 15rem;
  height: 15rem;
  background-color: pink;
  border-radius: 100%
`

const DoughnutChart = props => (
  <Doughnut 
    data={4.89}
  />
)

export default DoughnutChart
